import React, { Component, Button } from "react";
import ReactDOM from 'react-dom';
import "./App.css";
import "./components/MapContainer";
import Landing from "./components/landingpage";
import { Layout, Header, Navigation, Drawer, Content } from "react-mdl";
import MapContainer from "./components/MapContainer";
import CurrentLocation from "./components/Map";
import { Route, Link, BrowserRouter as Router,Switch } from 'react-router-dom'



const routing=(
  <Router>
  <div>
    <ul>
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/Landing">Landing</Link>
      </li>
      <li>
        <Link to="/MapContainer">MapContainer</Link>
      </li>
    </ul>
    <Switch>
      <Route exact path="/" component={App} />
      <Route path="/Landing" component={Landing} />
      <Route path="/MapContainer" component={MapContainer} />
    </Switch>
  </div>
</Router>

)
ReactDOM.render(routing, document.getElementById('root'));

const mapStyles = {
  width: "100%",
  height: "100%"
};

class App extends Component {
  constructor() {
    super();
    this.test = this.test.bind(this);
  }
  state = {
    showMap: false
  };

  test() {
    this.setState({ showMap: true });
  }

  render() {
    return (
      <div className="demo-big-content">
        <Layout>

          <Header className="header-color" title="Road Trip Advisor" scroll>
            {this.state.showMap ? <MapContainer /> : null}
            <Navigation>
              <a href="/">Home</a>
              <a href="/">Plan a trip</a>
              <a href="/">Sign Up</a>
              <a href="/">Sign In</a>
              <a href="/">Current Location</a>
            </Navigation>
          </Header>

          <Drawer title="Menu">
            <Navigation>
              <a href="/Home">Home</a>
              <a href="/Plan-a-trip">Plan a trip</a>
              <a href="/Sign-Up<">Sign Up</a>
              <a href="/Sign-In">Sign In</a>

              <a href="/map">
                <button onClick={this.test}>Current Location</button>
              </a>
            </Navigation>
          </Drawer>
          <Content>
            <div className="page-content">
              <Landing />
            </div>
          </Content>
        </Layout>
      </div>
    );
  }
}
export default App;
